const Form = () => {
  return (
    <form>
      <div>
        <label htmlFor="email">Email</label> <input type="text" />
      </div>
      <div>
        <label htmlFor="pass">Password</label> <input type="text" />
      </div>

      <button type="submit">Login</button>
    </form>
  );
};

export default Form;
